import React from 'react';

const PropertiesPanel: React.FC = () => {
    return (
        <div style={{ 
            width: 200, 
            border: '1px solid #000000ff', 
            padding: 16, 
            background: '#000000ff',
            color: '#ffffff',
            height: 'calc(100vh - 80px)', // Match the height of LayerLibrary
            overflowY: 'auto'
        }}>
            <h3 style={{ color: '#ffffff', marginTop: 0 }}>Properties</h3>
            <p style={{ fontSize: 14, color: '#ccc' }}>
                Select a layer to edit its properties
            </p>
        </div>
    );
};

export default PropertiesPanel;
